import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () =>{
    return (
        <nav>
            <NavLink to="/">Principal</NavLink>
            <NavLink to="/sobre">Sobre Nós</NavLink>
            <NavLink to="/">Sobre Nós</NavLink>
        </nav>
    );
};


export default NavBar;
